Зеленский на русском языке обратился к гражданам РФ.

Главное из выступления:

🔺нам не нужна война, ни холодная, ни горячая, ни гибридная;
🔺инициировал разговор с Путиным, но не получил ответ;
🔺война лишит гарантий всех, гарантий безопасности не будет больше ни у кого, пострадают больше всего люди;
🔺нужно остановиться, пока не поздно, но это зависит только от граждан РФ.

Коронавирус Украина🦠

Владимир Зеленский опубликовал очередное обращение к народу. О чем говорил, коротко:

▪️В Украине нет потребности в общей мобилизации, но необходимо оперативно доукомплектовать Вооруженные силы. Поэтому издал указ о призыве резервистов в особый период. Речь исключительно про граждан, зачисленных в оперативный резерв;
▪️В ближайшее время проведут обучающие сборы резервистов территориальной обороны;
▪️Запускают программу экономического патриотизма – дополнительные стимулы для локализации нашего производства;
▪️Пообещал снижение нагрузки на бизнес: ограничение проверок и уменьшение налогов;
▪️Анонсировал снижение ПДВ на бензин и дизель, соответственно опустится цена на заправках;
▪️Зеленский встретился со всеми главами фракции парламента и напомнил, что сегодня флаги всех партий сине-желтые.

Коронавирус Украина🦠

Байден обратился с заявлением после признания Россией "Л/ДНР". Главное:

🔺Путин готовит почву для того, чтобы продвинуться дальше в Украину. Он попросил разрешение у Думы на это;
🔺Санкции против России коснутся суверенного долга РФ и российских элит;
🔺США не имеют никакого желания сражаться с РФ, но хотят донести, что будут защищать каждый дюйм территории НАТО;
🔺Мы работаем вместе с Германией, чтобы остановить Северный поток-2;
🔺Россия - агрессор, но все еще есть шанс вернуться к дипломатии.

